import '../App.css'
export class Content extends Component {
  render() {
    return (
      <>
      <div className="heading"></div>
      <h1>Welcome to Flora sense</h1>
      <h3>Take care of your plant in few simple steps</h3>
      <hr /> 

      </>
    )
  }
}

export default Content
